import * as React from 'react';
import { StyleSheet, SafeAreaView, View, Text, TouchableOpacity, TextInput, Button, ImageBackground } from 'react-native';
import { IconButton, Colors } from 'react-native-paper';

export default function Light({ navigation }) {

  const pressHandler = () => {
    navigation.goBack();
  }

  const Temperature = () => {
      navigation.replace('Temperature')
  }

  const AirQuality = () => {
      navigation.replace('AirQuality')
  }

  const Home = () => {
    navigation.replace('Home')
  }

  return (
    <>
      <StatusBar style="light" />
      <View>
          <Text style={styles.text}>Light</Text>
      </View>
      <View style={{flex: 1}}>
        <View style={{flexDirection:"row", height: 50, bottom: -500, left: 20}}>
          <View style={{flex:1}}>
            <IconButton icon="thermometer-lines" size={50} onPress={Temperature}/>
          </View>
          <View style={{flex:1}}>
            <IconButton icon="air-filter" size={50} onPress={AirQuality}/>
          </View>
          <View style={{flex:1}}>
           <IconButton icon="home" size={50} onPress={Home}/>
         </View>
        </View>
      </View>
    </>
  );
}

const styles = StyleSheet.create({
  
  text: {
    textAlign: "center",
    fontFamily: "Cochin",
    fontWeight: "bold",
    color: '#3A6238',
    fontSize: 30,
    lineHeight: 40,

  },


});
